import React from 'react';
import './Home.css';
import Banner from './Banner';
import Card from './Card';

function Home() {
    return (
        <div className="home" >
            <Banner/>
            <div className="home__section">
                <Card
                  src="https://a0.muscache.com/im/pictures/eb9c7c6a-ee33-414a-b1ba-14e8860d59b3.jpg?im_w=720"
                  title="South Delhi AC pvt room+BATH+KITCHEN+2MIN TO METRO"
                  description="2 guests 1 bedroom 1 bed 1 bathroom, The host has equipped this place for long stays - kitchen, wifi, washer, and dryer included."
                />
            </div>
        </div>
    )
}

export default Home
